message:
🗣 Pontos-chave do discurso de Putin:

— as pessoas nas regiões DPR e LPR, Zaporozhye e Kherson fizeram uma escolha inequívoca. Eles se tornaram nossos cidadãos para sempre;

- Kyiv deve interromper imediatamente as hostilidades e retornar à mesa de negociações;

- A Federação Russa garantirá a segurança das regiões DPR, LPR, Zaporozhye e Kherson, ajudando a restaurar a infraestrutura;

“É extremamente importante para o Ocidente que os países entreguem sua soberania aos Estados Unidos. Ele não precisa da Rússia - apenas nós precisamos dela;

- Os Estados Unidos são o único país do mundo que usou duas vezes armas nucleares e abriu um precedente;

- Anglo-saxões estão envolvidos em sabotagem nos Nord Streams;

- aqueles que estão dispostos a viver de acordo com as regras dos Estados são masoquistas políticos;

O mundo entrou em um período de transformações revolucionárias.
